import logo from './logo.svg';
import './App.css';
import Ff from './new';
import Aa from './pp'
import Dd from './divv'
import Pp from './page';
import In from './nee';
import {BrowserRouter as Router,Routes,Route} from 'react-router-dom';
function App() {
  return (
    <Router>
    <div className="App">
      <Routes>
        <Route path="/" element={<In/>}/>
      </Routes>
    </div>
    </Router>
  );
}

export default App;
